CREATE TABLE fund(
   id                 INTEGER  NOT NULL PRIMARY KEY 
  ,name               VARCHAR(40)
  ,founded_at         DATE 
  ,domain             VARCHAR(35)
  ,twitter_username   VARCHAR(15)
  ,country_code       VARCHAR(3)
  ,investment_rounds  INTEGER  NOT NULL
  ,invested_companies INTEGER  NOT NULL
  ,milestones         INTEGER  NOT NULL
  ,created_at         VARCHAR(19) NOT NULL
  ,updated_at         VARCHAR(19) NOT NULL
);
